pragma solidity ^0.4.24;

contract EventContract {

  address public owner;
  string public name;
  string public place;
  uint public date;
  uint public capacity;
  uint public fee;
  bool public isPublished;
  uint public numberOfApplicants = 0;
  mapping (address => uint) public applications;
  mapping (address => uint) public refunds;
  address[] public refundsLUT;

  constructor(
    address _owner,
    string _name,
    string _place,
    uint _date,
    uint _capacity,
    uint _fee,
    bool _isPublished
  ) public {
    owner = _owner;
    name = _name;
    place = _place;
    date = _date;
    capacity = _capacity;
    fee = _fee;
    isPublished = _isPublished;
  }

  modifier onlyBeforeStart {
    require(block.timestamp < date, "This event has already started.");
    _;
  }

  modifier onlyOwner {
    require(msg.sender == owner, "This is admin method.");
    _;
  }

  function () public payable {
    apply(msg.value);
  }

  function apply(uint _fee) public onlyBeforeStart {
    require(_fee >= fee, "Fee should be larger than mininum fee.");
    require(isPublished == true, "This event is not published yet.");
    if (applications[msg.sender] == 0) {
      require(numberOfApplicants < capacity, "This event is full.");
      numberOfApplicants++;
    }
    applications[msg.sender] = applications[msg.sender] + _fee;
  }

  function cancel() public onlyBeforeStart {
    if (applications[msg.sender] == 0) return;
    refunds[msg.sender] = applications[msg.sender];
    refundsLUT.push(msg.sender);
    applications[msg.sender] = 0;
    numberOfApplicants--;
  }

  function publish() public onlyOwner onlyBeforeStart {
    isPublished = true;
  }

  function sendRefunds() public onlyOwner {
    for (uint i = 0; i < refundsLUT.length; i++) {
      address user = refundsLUT[i];
      user.transfer(refunds[user]);
    }
  }
}
